INSERT INTO `puja_history` VALUES ('01989606-0217-47d6-a220-af1506c8e82e',171,'Essence','Samvathsarikam/సంవత్సరీకం '),('0668a802-0635-4e2d-a16a-bec7c00e1c46',179,'essence','Paashupatha Homam/పాశుపత హోమం'),('066df199-d7d4-4dfc-9bd0-bd8dad2239c5',198,'Essence','వివాహం'),('0cbddabf-d7c8-4632-b85e-830117a84270',175,'Essense','Aabhdhikam/ఆబ్ధికం (One Bhoktha /ఒక భోక్త)'),('0f95d824-3d62-42df-8600-eac9849c27fa',192,'essence','నారాయణ బలి / NARAYANA BALI'),('11927d1a-73e8-4ac1-aa24-93aafe833467',106,'title','dec'),('1af1df7d-d37c-412c-a100-cbce5b07672f',154,'Essense','వ్యాపార ప్రారంభోత్సవం'),('1b835242-ed61-4d71-90fa-6cf77279137b',129,'Endgame','Lets get this son of a...'),('1bbc58fc-eaad-421c-a19b-c81590eb7087',181,'Durga Saptami','Pushpanjali'),('2031da3a-3a1b-47d4-a969-3f2edf1d1bfc',157,'Essense','Pitru devata trupti.  We are here because of our ancestors and they are a part of us.  They live on in our next generations as well.   \n\nBy remembering them and performing this puja every year, we help them in their onward spiritual journey, pay our homage and respect and also ensure better future for our next generations'),('214c48b2-1fd5-4901-b629-4174efd0dd57',173,'Purpose','Dasa danaalu/ దశ దానాలు '),('291cb677-169a-48da-b29a-29897181ea18',188,'essence','భువనేశ్వరి శాంతి పూజా/ Bhuvaneswari Shanthi Pooja'),('2932929d-d3f8-44eb-ae81-2efe6f96c751',182,'r','h'),('2a0c3399-c5d3-4dd5-b07d-867fff5e3f13',24,'When','This vratha can be done on any day, but it is much more beneficial to do it in certain months like Magha, chaitra, Vaisakh, Sravan, and karthika, or on days like panchami, dasami, ekadasi, purnima, chaturdasi, or sankranthi, and much helpful if done during evening time. Everyone is eligible to do this vratha.  Satyanarayana Vratha is also performed along with any important occasion in one’s life such as marriage, birthday, or house-warming. Many devotees perform the vratha in the evening after observing a day-long fast.'),('2c9b0556-ac16-4f66-8a85-9a16ef125da2',167,'Essence','Ganesha Navaratri / Vinayaka Navaratri is a festival which has a large significance and multiple benefits:\n\na) The puja performed on Ganesha chaturdhi, followed by 9 days until nimarjan , are primarily designed to get rid of our self ego and help us dissolve into the divine\nb) Children and all families come together in colonies, offices and societies and celebrate Ganesha\'s presence creating a strong bonding and cultural value\n'),('2eaece49-fbef-40fd-8bab-db0674e542ad',148,'Essense','The Maha Mrityunjaya Homam is done to achieve Jayam or Victory over Mritya (death). The procedure of this homam is by invoking Lord Shiva followed by the chanting of Maha Mrityunjaya Mantra for Longevity of Life and then performing the homam. Generally, this is coupled with Nakshatra homam'),('2f2162f9-69d1-40d3-8dc3-0b7be1093cd7',147,'Essense','Kubera governs and refers to wealth and prosperity. However wealth and riches only work in the ultimate favour of our life and spiritual journey both, when they are accompanied with benevolence and respect towards the wealth received.   Hence lakshmi devi, who can bless us with the true wealth of character is also prayed during the puja.\n '),('426a30f2-2ee6-4833-aa69-21f007abb731',178,'Essence','To perform vinayaka chavithi pooja at home'),('446c0dfd-03dc-4480-833d-979a5ef45bc6',168,'Essence','Vinayaka Chaturdhi / Vinayaka Vratam is a promise and resolve to surrender one\'s ego, layer by layer. \n\nVinayaka is prepared using river clay and worshipped with 21 ayurvedic patri.  After the leaves have fully dried up, the nimarjan is performed back into waters.  The ayurvedic properties of the herbs help cattle and others relying on the water for drinking and cleaning purposes\n\nMachi Patram	Purification Air and Water\nBrihathi Patram	Women Post delivery\nBilva patram	Purifies water even stagnant\nDurvara Patram	Skin diseases\nDattura Patram	Poison effects removal\nBadari patram	Improves cow fodder\nApamarga Patram	Poison effects removal\nTulasi patram	Purification Air and Water\nChoota Patram	Throat diseases\nKaraveera Patram	Lice\nVishnu Kranta Patram	Memory\nDaadimee Patram	Pregnancy protection\nDevadaaru Patram	Insect and mosquito repellent\nMaruvaka patram	Heart diseases\nSindhuvara Patram	Poison effects removal\nJaji Patram	Cure Indigestion\nGandaki Patram / Jambeera	Skin diseases\nShami Patram	Hair removal purification from water\nAswatha Patram	Good for animals goats\nArjuna Patram	Wounds septics\nArka Patram	Poison effects removal \n\n\n'),('478e7620-7710-495a-8aad-d3b727c19b15',143,'Essense','The puja focuses on space consecration to remove all negative energies, after which one may begin to utilize the land. Here, a land is seen as a space having its own unique energy, just like a living person. By living in a house, we are coming into contact with its current energy. Therefore, with the help of the mantras and puja we are purifying the house’s environment and inviting positive energy, to ensure our growth and well-being.'),('4e673261-ae46-46d5-9fc2-b83088c8bef1',140,'Essense','Seemantham ceremony marks a woman\'s passage into motherhood and celebrates her fertility. From the day of formation in its mother\'s womb, a child grows in different stages, each with a stipulated time frame'),('50a381c8-9de3-4573-883f-39d026792b14',128,'test','my name'),('51017b36-cfd9-4a07-ba0f-2e4a8c1558b4',145,'Essense','o comprise the Shastipoorthi pooja cost gowri, Ganesh, Kalash sthapana, and prayers are to be done to get the blessings. Recitation of several Vedic mantras, such as Varuna Sooktha, Purusha Sooktha, Nakshatra Sookhta, and Dik Palaka Mantras done and concluded with the performance of Dosha Shanti'),('53320a5b-1663-45a5-86f5-945cb5399eda',110,'testing1','testing1'),('5371a3a2-e253-40f3-85e3-624cb71722da',195,'essence','లక్ష్మి గణపతి హోమం / Lakshmi Ganapathi Homam'),('53fc398c-898b-4d7f-9661-010119df11c7',142,'Essense','By the guidance of a guru, the janue thread is placed by the father across the boy\'s left shoulder. Then, Munja grass is tied around the child\'s waist to save the child\'s purity and keeps away the evil eye'),('54d63662-52e7-4a59-b04c-886943dc5167',189,'essence','పూజ సామాగ్రి /Pooja Samagri'),('55b674d6-f4cf-451f-81f1-611956ba59ac',10,'Benefits','This puja is a way to interact with the material world, so that it responds to our needs and facilitates happiness. It is designed to provide us with an opportunity to perform the following:\nOffer penance or a sense of Prayaschitta to all the plants, insects and other life forms that have gotten displaced, or killed during the construction of this house\nOffering our gratitude to the divine for blessing us with a place to stay, be protected and to pursue good deeds and progress spiritually \nUse the energy of the mantras to invoke the deities and to make the house a compatible space for the people living in it \n'),('5615f410-e080-48fd-b086-f85a0dd0a764',139,'Meaning','According to the Grhya Sutras, at the beginning of the performance of this saṃskara, the wife is traditionally dresses and the husband recites Vedic verses consisting similes of natural creation and invocations to gods for helping his wife in conception. Then embracing begins during verses consisting metaphors of joint actions of male and female forces signifying and reminding the purity, divinity and importance of the act of conceiving another life form .  The husband then, reclining over her right shoulder, recites a verse, \"O, you, whose hair is well parted. Your heart which lives in heaven, in the moon, that I know, may it know me. May we see a hundred autumns.\"'),('5634cb88-8e2e-48a9-9353-c4eccd6905c3',186,'Title','Description'),('59667888-974f-4a06-8fa5-2bf3639f7bfc',176,'Essense','Masikam/మాసికం ( ఒక భోక్త/ One Bhoktha)'),('5d146504-cc80-4972-9de6-224679a26913',10,'When','The puja is generally performed just on the day / the day before the family is about to move into the house.  The exact date and time is suggested by the pujari, that which is most compatible with the birth nakshatras of the people performing the puja. '),('5dbffac0-2bee-4015-b220-48ba03f131e5',136,'What is Lakshmi','In general, Lakshmi refers to \'wealth and prosperity\', \'abundance and richness\'. However \'Lakshmi\' also refers to \'possessing something extremely rare within\'.   \n\nImagine a person who has never looked at any other life form with even an iota of anger, this is Lakshmi\nAble to see ammavaru in every woman and serve them, this is Lakshmi\nAble to understand Dharma and act accordingly in every situation, this intelligence is Lakshmi\nHaving a personal strong relationship with daivam is Lakshmi\n\nIn Varalakshmi vratam, we are praying to the mother who can bless us with wealth AND this lakshmi.  \n\nLakshnala koladi Lakshmi'),('5e494a40-6764-4342-8c58-f756f3f923f0',10,'Essence','Gruhapravesha is a puja that focuses on space consecration to remove all negative energies, after which one may enter their new house. Here, a house is seen as a closed space having its own unique energy, just like a living person. By living in a house, we are coming into contact with its current energy. \nTherefore, with the help of the Grihapravesh mantras and puja material we are purifying the house’s environment and inviting positive energy into the home, to ensure our growth and well-being in the house.'),('6083e731-323b-45a9-abfa-eadf66dbdfbb',199,'Essense','ఆడ పెళ్లి వారికి\n'),('63e5aaf0-15da-4e31-bdd2-1775776f57e6',125,'test','thetbsklbkbxx'),('645a2245-b42b-488b-8cb7-c2aec51c8e76',97,'as','asa'),('6862da41-005a-4d5c-b710-a3a651c15bd3',155,'Essense','In sanatana dharma, cleanliness (suchi) and purity (suddhi) are seen as two different things.  Water that is energized due to the mantras of Punyahavachanam have the ability to cleanse 8 aspects which are: Gruha, bhu, bhanda, atma, dravya, jala, sthala, shareera, and padartham.'),('7026d096-a5c4-4dfa-b85f-4dd0dc437ff5',123,'testt','testts'),('772dec95-817b-4611-948c-377f01a71ef9',158,'Essense','This ritual is part of Antima Sanskara, and it is performed to let the soul attain peace or to move forward into the next birth with a higher purpose. The samskaras that are performed up untill the last one are for the well being of a person in this world, but anthima samskaras are performed to help the person\'s soul into their afterlife. \n'),('7a24a3ba-b3a8-4eed-930d-9222e864741d',183,'essence','సరస్వతి పూజ  పిల్లల కొసం / Saraswathi Pooja For Kids'),('7f371eef-137a-4641-a9f1-3eddf1f66610',194,'essence','వాస్తు పూజ / Vasthu Pooja'),('877bb2f5-7b50-49dc-ba77-a0351f6fa7b0',98,'as','asa'),('8c89b4ca-111e-403d-86fe-3566754688d6',181,'Durga Astomi','Pushpanjali'),('9201d0a1-7554-4a7f-aaf9-047e2bb016ff',107,'testtt','testing'),('94d62dd4-bdaf-48fe-ba66-3624667b6353',182,'ganesh ','puja'),('9597586d-3148-4829-ac37-38ab56e1ba2d',156,'Essence','Samvathsarikam 3 days. Krisha Yajurveda sampradayam'),('971e9f94-7ad2-4d3c-aec2-5e4da942de41',172,'Essence','Chandi is the summation energy of all things in the universe. As the Sun shines his light on everything equally, in the same way, the energy of the Goddess equally permeates everything.\nThis energy exists in many forms. In our body, the kundalini energy represents one such form of this energy.\nLord Shiva is our consciousness, and Goddess Chandi is Shiva’s Energy Vibration. Together, they both manifest everything.\n\nThere are three qualities, which are known as gunas that are present in everyone. These gunas are Satva, Rajas, and Tamas. Even though the gunas originate from Devi, she is not affected by their qualities.  These three gunas are also associated with the Earth, the Sun, and the Moon, and also with the three forms of Devi, which are, Durga, Lakshmi, and Saraswati. \n\nIn Chandi Homam, all the three forms of devi are worshipped and finally mother is worshipped as Chandi\n\n'),('a05f7481-899d-41d9-b8f5-e57b11893c54',4,'When','The ceremony is generally  held either on the 11th day or 21st day of the new born baby. If not on the 11th or 21st day, this is done on an auspicious day in the 3rd month after a consultation with the pujari or astrologer. '),('a66b599f-aaa1-4cc4-9d7f-fe335cdf8c40',149,'Essense','Ayushya Homam is performed to improve one\'s health. This divine pooja has many other great benefits and brings happiness and prosperity to the lives of people. It is a pooja dedicated to Ayur devta or the God of life. This homam is done chanting Ayush Shuktha and chanting Ayur devata '),('a6d9d472-dc9e-4241-aee1-5d0e3a9415e7',138,'Essense','On the day of Punsavanam , the couple worship Lord Ganapati after taking a proper bath and pray for the good health, well-being, and future of the child. Many people also perform yagya and chant the Gayatri Mantra on this day. Kheer is offered in the yagya, and the same kheer is eaten by the parents of the child as prasad. After this, the blessings of the elders of the family are taken. People also do daanam, depending upon their financial capability.\n'),('af94101b-ff95-49b2-8384-613d63f05818',144,'Essense','To wash the right hand, Pujari will give the owner of the car the sacred water from the Kalash. They will do it three times. The pandit will hand the automobile owner the rice to sprinkle over the front of the vehicle. The pandit creates a swastika on the car hood using water, turmeric powder, and sandalwood paste'),('b295d89e-03d9-41b4-9ff9-f189f769959d',6,'Essence','Aksharabhyasam is made up of Akshara and Abhyasa. Akshara is a unit of writing, where \"Aa \'\' means \"not\", and \"Kshara\" means that which disintegrates or breaks away\". So, Akshara is that which is fixed and imperishable, and Abhyasa means \"Practice\". \n\nThis is a Puja where a child writes for the first time and receives the blessings of Goddess Saraswati and Lord Ganesha. Goddess Saraswati is the Goddess of speech, and the mother of vedas. Lord Ganesha is also called as Buddhipriya, meaning he is fond of intelligence. \"Aum\" which is called as \"Eka-akshara\", is seen as the sound-form of God, and is the primordial sound from which manifested the entire universe.  Hence this is the first letter that the child is made to write.'),('b2b1bb5d-a4ee-4add-bed6-29a8d9f6232f',16,'When','The appropriate muhurtham , date and time is recommended by the pujari based on the purpose and nakshatra'),('b5f9cfcc-4a61-48a9-8cb0-8b57d3163aeb',191,'essence','Pooja Samagri'),('b6ad72e9-4ec9-4517-990a-0d104b25d0c6',141,'Essense','The ceremony is a puja followed by the rice feeding. It is arranged in consultation with a pujari who selects an auspicious date when the child is five to eight months old. Odd months are generally auspicious for baby girls (month 5 or 7) and even months (month 6 or 8) for baby boys.\n\nWeaning away from mother\'s feed, the baby is now being introduced to outside food for the first time.  Our rishi darshana saw that a portion of we eat forms our manasu (thoughts/feelings/emotions/reactions) and therefore our personality.  \n\nFood, and how it is consumed is looked as a very pious activity, and since this is the first time for this shishu (baby), the puja is performed to seek divine and guru\'s blessings.\n\n\n'),('b77f8485-99ee-4fae-bdec-aa628e5f0468',190,'essence','కేదారేశ్వర  వ్రతం / Kedareswara Vratham'),('b95b7aad-9bfd-4fc7-90f2-138739f64504',4,'Essence','Three different names are assigned to the baby. Nakshatra , Maasa and Vyavaharika,  during the Naamakaranam puja\n\nVyavaharika name becomes the social identity. \nNakshatra name is selected based on the  \'nakshatra\' or stars present at the moment of the baby birth . \nSimilar to Nakshatra name, Maasa name is selected related to the month (maasam) in which the baby is born\n\nIn Sanatana Dharma, there are governing deities (adhistana devatas) the govern each star, each month etc.   The nakshatra naamam and maasa naamam are related to this particular aspect. Depending on the time of birth, sometimes pujari recommends certain specific pujas to nakshatra/maasa/navagraha devatas for smooth life ahead for the child. \n\nAlso uttering a certain vedic name repeatedly has several benefits for the person calling out the name and the bearer. (name) when picked  and have a certain amount of influence Therefore, several choose to name the baby after a deity, a sacred place or river, or a saint as a constant reminder of the sacred values the name represents. \n'),('bc76dd5f-9198-46b7-bd25-2739d2214720',135,'What do the Navagrahas signify?','There are several cosmic forces which can have an impact on the Panchabhuta, and can therefore also impact our body, because our body is a part of this cosmos, and made from the same elements. This impact exerted by the cosmic forces on the Panchabhuta and Vata-Pitta-Kapha, can be observed through the tendencies demonstrated by a person in their lifetime with reference to the Navagrahas. The Navagrahas being cyclical, can indicate the predictable path a person will take, based on the time and location of their birth. They are like a map of a person’s current life’s karmic journey. \n'),('c3a2248b-0413-470d-be50-785ff556c4b7',109,'Testing1','Testing2'),('c67ecb1c-6a2c-4f62-860f-f2fce681c47b',126,'test history','new test1'),('c6d4dcd9-52a1-4296-b169-f3ade93d223a',127,'sas','asas'),('c8fbb121-d3b8-47ca-9a8f-712be2ca8d85',132,'Essence','We begin the Abhishekam by bowing down to Lord Shiva with respect. We then recite the greatness and grandeur of Lord Shiva. When we chant the Rudradhyayam in this way along with Panchamrutha Abhishekam, we can heighten our devotion towards Lord Shiva, which will eventually lead to the manifestation of knowledge in us, and due to this knowledge, we are able to see the presence of Shiva everywhere.  \nShiva is the consciousness of everything, including the five basic elements of nature, called Pancha Bhootas. The panchamrutha represents the pancha bhootas with which the entire universe is made. Through Abhishekam, we are offering the Pancha Bhootha, and Dravyas back to Shiva. '),('c9b1826b-b84a-4c4c-8898-b9187a41bb5e',108,'testing7','testing7'),('c9c6d03a-94f5-4b47-8345-b9f79782ef55',197,'essence','వివాహ నిశ్చయతాంబూల సామగ్రి/ Marriage Engagement'),('cb7cae5b-d5c6-4ad7-b4d1-2b9475e7df8b',24,'Benefits','The vratha increases the unity among family members, and prospers the family with marriage and children. The Satyanarayana Vratha stories focus on the importance of honesty and keeping one\'s promise and the deity reinforces this conviction in our subconscious mind. This moral behavior is important for maintaining a positive inner environment and for advanced yoga sadhana. '),('cc8f68df-15cd-4bbb-b272-0c6cee630f31',136,'Essense','Vratha and truthfulness are a part of Ashtanga yoga. They act like external support systems which support our inward journey to achieve a balanced state of mind.\n\nFor a person to attain higher levels of connect with the divine and ultimate union (yoga), the rishis have identified that personality refinement is mandatory. Without refining one\'s character, even if several other saadhanas, niyamas, deekshas, punya karya etc. are attempted, they lead to a large building that is being constructed on a shaky foundation and hence ends up becoming unstable\nVrathas are promises made in the presence of the divine to improve and maintain certain aspect in our personality. \n\nVaralakshmi vrata is very easy to perform, but the promise is EXTREMELY HARD to maintain.   To summarize, the promise is this: \" Can we wish for prosperity and wellbeing of others, equally to ours?\'. \'If someone is doing better than us, can we have absolutely zero disturbance within us\'.\nIt seems simple but in a world that is constantly measuring success in material aspects, it is never easy.  \n\nBy performing this vrata every year, we reiterate this promise and seek Lakshmi\'s blessings to give us the default mindset to remain in this manner. \n\n\n\n\n'),('d0f18f3c-1185-4b67-aee7-36982b33ab3f',24,'Essence','Vratha and truthfulness are a part of Ashtanga yoga. They act like external support systems which support our inward journey to achieve a balanced state of mind. The Satyanarayana vratha is a Puja to Narayana as a form of \'Truth\'. Even the stories which are read as a part of this puja aim to reinforce our resolve to become more truthful and transparent with ourselves. Lord Satyanarayana is seen as supporting people who are sincere in their efforts. '),('d275825f-6278-4278-9a8f-fdefa87ebcc2',169,'Essence','Aabhdhikam/ అభ్ధికం '),('d453b731-4fe5-4922-8db2-7761565be5d3',137,'Essense','Vratha and truthfulness are a part of Ashtanga yoga. They act like external support systems which support our inward journey to achieve a balanced state of mind.'),('e0963191-5c66-4178-a27d-0ee59d90390f',196,'essence','Masikam/మాసికం ( ఒక భోక్త/ One Bhoktha)'),('e44bdbab-84f0-4259-b6b2-38924efa24be',146,'Benefits','The shakthi swaroopa that governs everything related to absorption of energy is Saraswathi Devi.   Hence this homam has been regularly recommended and utilized for students and children. Some of the common benefits that devotees seek and stand to gain from this homam are:\n\n1. Sharpens skill sets, concentration, memory power, focus and our ability to understand complex things\n2. Smooth sailing in all literary pursuits\n3. Instill confidence in the individual to achieve great success\n4. Attain high intellectual and analytical skills and empower one with high self-esteem thereby helping in attaining positive results.\n\nIt is also recommended at times by vedic scholars for anyone who has speech/communication-related problems. It also helps in curing defect like stammering by the devi\'s grace.'),('e47cf473-e2f7-4b40-81de-9dc017e86dc7',150,'Essense','When karmic tendencies or situations around us push us to a corner and we are in fear or state of worries, homams like sudarshana help lift the devotee from that state to be able to once again traverse through life smoothly and continue seeking eeshwara.  \nSudarshana represents the yoga kundalini shakti of lord vishnu . Hence it has no parallel.  \n\nThe puja is also to be seen as a reminder / wake up call to start focussing on one;s own tapas and mantra japa.  This provides the saadhaka a permanent connect with eeshwara and a protective aura around the person'),('e9950ab3-a29d-4113-a16a-5757a37ed48d',93,'Background test','Background - Description test'),('eb1f1ec0-7d39-4307-ab72-f5610ee0190b',24,'Background','Sri Veera Venkata Satyanarayana swamy is an incarnation of Vishnu, and the main deity of the famous Annavaram temple in Andhra pradesh. Lord Kumaraswamy heard about the Satyanarayana vratha from Lord Shiva and Devi Parvati, and passed it onto Agastya muni. From Agastya Muni, others learnt it and Ved Vyasa wrote about it. Then Ved Vyasa\'s student Sutha Muni learnt it from him and passed it on to several of his disciples. Rishi Narada is said to have preached the glory of the Satyanarayana Vrata, to relieve human suffering, after he learnt it from Lord Narayana himself.'),('ec3ae454-990e-4c32-a554-e503dafaa97a',184,'Internal','Internal'),('ede534a9-b4a2-4d43-8def-9637a07c865b',135,'Why do we worship the Navagrahas?','Each person’s senses record and store a lot of information about them. This memory is called Karma. This memory contains our predictable habit patterns, tendencies, social triggers and their responses, and our likes and dislikes. The tendencies stored in our subconscious memory are awakened due to a unique combination of three energies called Vata, Pitta, and Kapha. The Vata, Pitta, and Kapha are energies in a person’s body, which are formed due to different combinations of the five elements or Panchabhuta, and their imbalances can lead to various illnesses. When a person’s karmic energy is imbalanced due to various factors it could lead to wrong decisions, unfavourable events, illnesses and so on.\n\nNavagrahas, and the cosmic force behind them, and their mantras, all represent the same energy. Therefore, when we worship a certain Navagraha, the imbalances associated with that Graha are resolved. Navagraha shanti is about pacifying the cosmic forces, reducing the intensity of negative karma, and turning them towards favourable results\n\n'),('edf70487-4fe3-4dee-8f07-c89b2a47f961',182,'q','q'),('efa717c7-84b5-4ece-8b7e-4d340e6b07ad',182,'2','3'),('f0b93ab4-8591-478d-b9ec-bf11c756b522',16,'Background','Homa is a fire ritual. Fire rituals are fundamental to Sanatana Dharma. Basically, in this ritual, we consecrate a fire and worship the devata in the form of fire.\nWhen we worship a murti made of mud or wood, we are worshiping the devata through Prithvi tattva, similarly through fire, it is agni tattva. In the same way, all the five tattvas can be utilized for the worship of a devata.  Agni Devta or the god of fire, is considered to be the distributor of energies. Fire is seen as a portal to the higher realms and higher energies. \n'),('f5fefa15-8897-4d93-adaa-40e21bad0dd5',193,'essence','గుమ్మం పూజ / Gummam pooja'),('fcada3de-9594-4ea8-b9a3-c5044e4045d9',187,'essence','ఆరోగ్య పాశుపత పారాయణం మరియు హోమం / Aarogya Pasupatha Parayanam And Homam'),('fcd2cb98-cadb-4a74-b9e1-31cefc6b611f',129,'the Avengers','Earth\'s mightiest heroes');
