INSERT INTO `puja_procedures` VALUES (2,'telugu','Simha Dwara Puja','The main dwaram / door to the house is referred to as Simha dwaram.  This is the main route in which we enter and exit the house,  This is the entrance which is exposed to outsiders.  Through righteous living in gruhashashram, the simha dwara becomes like the entrance of a temple.   Puja is performed at simha dwara with dhravyas such as turmeric, haldi, navadhanyas etc. as per one\'s respective cultures. The lady of the house tries to ensure that the simhadwara decorated with rangoli, smeared with turmeric and auspicious symbols like swasthik etc.. It is respected as a sacred place and hence we are generally also adviced not to place any slippers right in front of it',NULL,NULL,NULL,NULL,NULL),(4,'telugu','Gruha Pravesha Muhurtham','The auspicious muhurtham that was decided as the moment during which the family head along with other members enters the house along with their devatha murthy and photoframes.',NULL,NULL,NULL,NULL,NULL),(6,'telugu','Punyaha vachanam (Laghu)','Punyaham means auspicious, and vachanam means to recite. In this step, mantras are recited which purify us and our surroundings and bring forth the auspiciousness required before performing a vedic action. This step is given in yajurveda and rigveda, and requires kalasham to perform it. It is performed to purify 8 things which are: Gruha, bhu, bhanda, atma, dravya, jala, sthala, shareera, and padartham.',NULL,NULL,NULL,NULL,NULL),(7,'telugu','Raksha bandanam ','A sacred thread is tied to the individuals performing the puja, while chanting mantras. This signifies their determination to begin the ceremony.',NULL,NULL,NULL,NULL,NULL),(8,'telugu','మండపారాధన/Mandaparadhana','Aavahanam of navagraha, ashtadikpalaka, panchalokapalaka, trimurthulu, ishta devata, kula devata, and nakshatra devatalu.',NULL,NULL,NULL,'2023-11-06 14:40:44',NULL),(9,'telugu','Vaastu Kalasa sthapanam and Puja','Vaastu purusha aavahana is performed into the kalasha thus enabling the devotees to pray and seek for the blessings of an amsha of this abstract form that governs the space that we are going to live / work in. Depending on the tradition followed in the yajamani (doer\'s) house, kalasha prathista is done and sometimes not. ','Few customers opt for very detailed and elaborate vaasthu puja which includes things like: sarvathobhadra mandalam, vaasthu bomma / bimbam etc.. You can discuss with pujari in the call if you are interested in the same.',NULL,NULL,NULL,NULL),(10,'telugu','Ganapati Homam','Ganapati aavahana happens via mula mantram in different forms via bheejaksharas such as vallabha ganapathi, lakshmi ganapathi, varasiddhi vinayaka etc.  This main shakthi amsha of ganapathi that has been invited is then offered havissu during homam',NULL,NULL,NULL,NULL,NULL),(12,'telugu','Vaastu Homam','Homam specifically conducted to remove any vaastu doshas in the space and make it conducive for positive and uplifting activities.','In certain cases, esp. for houses where owner/ tenant is performing for rental etc..homam is skipped. You can discuss and mention the same with the pujari during your call.',NULL,NULL,NULL,NULL),(14,'telugu','Aashirvachanam','The guru aashirvachanam is the biggest blessing for the devotee or the family performing the puja.  Guru is eeshwara\'s form in front of us. His tapasya and veda parayana, nithya gayatri japa etc. mean that his blessings can lead to god\'s grace.',NULL,NULL,NULL,NULL,NULL),(15,'telugu','Sankalpam','Sankalpa is the reason for performing this puja. The puja depends upon the Sankalpa or will of the participants. Each puja is performed for a definite purpose and it is this purpose that the performer and participants must hold in their hearts as they take the Sankalpa. \nThe Sankalpa mantra begins by stating the name of the present year, month, season, phase of the moon, the day, time, and the Nakshatra, as per the Indian Calendar. \nIt then states the name of the deity, whom we are invoking for this puja. And finally, the individual or family who will be performing this puja, and the purpose of the puja.',NULL,NULL,NULL,NULL,NULL),(16,'telugu','Ganapati Puja','Lord Ganapati, is worshiped before starting anything because: \n\nThe Muladhara Chakra, the first Chakra of our body, is the foundation for our body. As Lord Ganapati is the Lord of the Muladhara Chakra, we pray to Him to help us finish the puja without any hurdles. Even our speech starts from the Muladhara Chakra as a subtle sound. Lord Ganapati is therefore called the Lord of speech, and the personification of Aum, the primordial sound.\n\nThe amsha / part of Ganesha\'s energy that is invoked at the start of every puja is essential for the siddhi of the mantras and for the thoughts to reach the devatas that are being worshipped\n\nGanesha is the creator and destroyer of obstacles. His prayer in the beginning becomes essential for nirvighna (no hurdle) puja completion',NULL,NULL,NULL,NULL,NULL),(17,'telugu','Mandapam','A devotee can worship his/ her Ishta devata, to help them achieve their wishes and to eventually move onto Moksha. Since, It is not easy to concentrate on the formless, we invite the devata to descend into a form. A devata is pure consciousness, who does not have a form. Just like water, the devata can be invited to take the form of the vessel, known as an Upadhi. It is like freezing water into an ice-block of desired shape.  Mandapam is a suitable place that is prepared prior to starting the puja where devatas can be invoked and concecrated until the puja ends. ',NULL,NULL,NULL,NULL,NULL),(18,'telugu','కలశారాధన/Kalasa aaradhana','Here, water in a pot acquires the qualities of holy rivers, through the chanting of mantras. The \'Kalasa\' accumulates all the positive vibrations during the puja and the same is transferred to our bodies when its water is sprinkled on our head and food items at the end of the puja.',NULL,NULL,NULL,'2023-11-06 14:43:09',NULL),(19,'telugu','Pancha loka palaka puja','In Sanatana Dharma, different worlds exist together like a multiverse, called lokas.\nFor Example: When we refer to the Vaikuntha Loka, ‘Vai’ means ‘No’ and ‘Kuntha’ means ‘anxiety’. So, for the people living in Vaikuntha there is ‘No-anxiety’. Similarly, Kailasha is called the loka of Lord Shiva, where his devotees reside. \nIn Pancha Loka Palaka Puja, we bow down to the rulers of five lokas: Ganapati Loka, Brahma Loka, Vishnu Loka, Rudra Loka, and Gouri Loka.',NULL,NULL,NULL,NULL,NULL),(20,'telugu','Ashta dikpalaka puja','Ashtadikpalakas denote that God is in every direction, and that there is a specific energy and deity in each direction. Each energy has specific qualities and is suitable for different activities. We perform this puja to balance the five elements in these directions.\n\nThe Ashtadikpalakas of various directions are:\nKubera for North,\nYama for South,\nIndra for East,\nVaruna for West,\nIsana for Northeast,\nAgni for Southeast,\nVayu for Northwest,\nNirrti for Southwest.',NULL,NULL,NULL,NULL,NULL),(21,'telugu','Satyanarayana Puja','Satyanarayana Puja',NULL,NULL,NULL,NULL,NULL),(22,'telugu','Abhishekam (Panchamrutalu)','Abhishekam can be seen as watering the roots of a tree. Only if the roots of a tree are nourished, it can produce fruits. During an Abhishekam, the results that we desire to see in this world are like the fruits of a tree, and the divine beings who influence these results are like roots. Since, everything in this universe is interconnected, we perform Abhishekam to see specific results in the world.',NULL,NULL,NULL,NULL,NULL),(23,'telugu','Archana ','During Archana, we offer flowers to a deity while chanting mantras or names of the deity. The flowers that we offer have a fragrance. Another name for fragrance is vasana(tendency). Therefore, offering flowers to a deity represents offering all our vasanas to the deity. And, while we let go of our vasanas, we chant the names of the deity, to connect with the divine.\n\nSometimes archana is performed with other dhravya like leaves that are most suitable for that particular devata. For e.g. tulsi, bilva etc. ',NULL,NULL,NULL,NULL,NULL),(24,'telugu','Vrata Kadhalu','Vrata Kadhalu remind us and re -nforce the main promise (vrata) that we are undertaking as part of the puja.  The stories are designed with characters from the puranas whose smarana (rememberance) has a positive intent and impact on us. Hence the stories are not changed. ',NULL,NULL,NULL,NULL,NULL),(27,'telugu','Chandi Parayanam','Brahmin who has initiated into chandi will do parayanam and japam and give theertham to yajamani\n1 time, 3, 5, 7, 9 times parayanams repeats\n1.5 to 2 hrs for 1st parayanam + 1 hr for every next iteration\nAfter parayanam, prasad, generally fruits is given ',NULL,NULL,NULL,NULL,NULL),(28,'telugu','Parayanam + Homam','Sarvathobhadra mandala sthapana\nDevi aavahanam\nDevi pooja\nHomam - Homam has two aspects : svahakaram and uvacha\nSvahakaram with ghee and bellam annam \nUvacha with betal leaves with kumkuma and pasupu\n13 adhyayas - Items and devi names \nFor every adhyayam: Item + jacket piece + bangles\nAt last: saree + purnahuthi',NULL,NULL,NULL,NULL,NULL),(29,'telugu','Navachandi','Devi 9 forms \n9 parayanams + homam + various articles like : jajikaya _ japatri + lavangalu + yelakalu + vatti verlu + gajulu (bangles) + dry fruits + pasupukommulu',NULL,NULL,NULL,NULL,NULL),(30,'telugu','Saraswati Homam','Ganapati, navagraha devatas and all other deities such as ashtadikpalakas, panchalokapalas, trimurthulu which are generally invited during mandaparadhana are given havissu (offering in the homam via swahakara and agni devata).\nFinally, along with the recititation of saraswati suktham as well as108 repetitions of saraswati moola mantram, the devi is offered havissu.',NULL,NULL,NULL,NULL,NULL),(31,'telugu','Govu puja / Govu pravesham','The reason for making a cow enter a new house before the family members is to resolve any vastu doshas, if present in the house. Since, it is believed that, every aspect of a cow is associated with a deity, the cow helps bring peace and prosperity in the house.','If you can accommodate and wish to have an actual cow enter your space, please mention the same in special notes or to our representative.  We will verify if it is safe and convenient to gomatha and arrange for the same.',NULL,NULL,NULL,NULL),(32,'telugu','Purnahuthi','When you offer dravya to the fire with a decent mental focus, some of your karma is brought out and burnt. Then, you will be left with lesser karma to experience. But, If you are one who knows how to surrender, all this is irrelevant to you. To be able to see the lord in everything, everywhere, and at all times is true surrender.',NULL,NULL,NULL,NULL,NULL),(33,'telugu','Aksharabhyasam','Aksharabhyasam',NULL,NULL,NULL,NULL,NULL),(34,'telugu','Naivedyam','The final result is called Karma Phala when we perform an activity. The fruit of a tree represents the tree\'s karma phala because it is the result of all the tree\'s growth activities. Every result carries a seed for more karma. This is just like a fruit containing a seed, to produce another tree, and so on. To escape this self-repeating cycle, we offer the fruit of our actions to our devata. Offering this to our devata prevents us from creating new karmas or vasanas while enjoying our Karma Phalas.',NULL,NULL,NULL,NULL,NULL),(35,'telugu','Harati','To remind us repeatedly that the Ego must be dissolved, we light the Camphor symbolizing the Ego. Our presence without an Ego is symbolized by the fragrance left behind by Camphor when it burns. Another reason for doing a Harati is to show devotees a glimpse of the devata. This is because it is usually dark in a temple\'s innermost sanctum. So, the more our EGO burns away, the more we see the divine.',NULL,NULL,NULL,NULL,NULL),(36,'telugu','Aada bidda - Gadapa Kadagadam','Most of the negative energy in the house, if any, is deposited on the frame of the main entrance door. Due to this, before entering the house, we apply yellow turmeric paste, red kumkum dots, and white lines to the door frame. White represents Saraswati, yellow represents Lakshmi, and red represents Gowri. The three mothers protect the family. At the entrance of the house, the lady of the house draws rangolis (geometric shapes conducive to positive energy), inviting goddess Lakshmi in her thoughts and emotion to visit the house.',NULL,NULL,NULL,NULL,NULL),(37,'telugu','Ash Gourd break / Gummadikaya kottadam','As the vegetable called Ash gourd is very high in life energy, it is broken in front of the door.\nAnother ash gourd (a full one, not damaged) is sometimes hung at the entrance after puja and replaced regularly. This wards off any Nara drishti doshas and keeps positive energies flowing into the house.',NULL,NULL,NULL,NULL,NULL),(38,'telugu','Breaking Coconut','By offering a coconut to the devata, we offer ourselves in the form of a coconut. First, the outer layer of a coconut called coir, is removed, because it symbolizes all our desires, likes, and dislikes. Next, only the hard shell remains between us and the devata. This hard shell represents our EGO, which we break at the feet of the devata. The remaining thing is our inner self symbolized by coconut water which spills at the devata\'s feet. On the coconut\'s hard shell, there are three hole-like marks. These three holes represent all that is three. This includes the body, mind, and intellect, the three Gunas, the three Kaalas, and the three states of consciousness. Therefore, breaking a coconut symbolizes not just breaking our Ego, but also transcending all the things in the category of three.',NULL,NULL,NULL,NULL,NULL),(39,'telugu','Plate of rice with gold ring wrapped with darbha','As Darbham grass absorbs radiation from the atmosphere, it is also used to cover all food items during eclipse time, to protect them. Darbham is also an effective conductor of sound vibrations, which makes it suitable to absorb and transfer Vedic chanting vibrations.',NULL,NULL,NULL,NULL,NULL),(40,'telugu','Pranayama','Prana is the energy that supports our body\'s functions, and our breath is one of the sources of Prana, apart from food and sleep. Using pranayama we can control breath flow. The benefits of controlling our flow of breath are increased energy, stress relief, and improvement in mental clarity and physical health. It is known as an effective way to calm down and increase focus instantly.',NULL,NULL,NULL,NULL,NULL),(41,'telugu','Pradhana Kalasa Sthapana','The main kalasham is prepared in order to concecrate the energy of the devata being worshipped.  The pot is generally filled with rice grains or jala, and mango leaves surrounding a coconut on top. The coconut represents the devotee, and the mango leaves arranged around the coconut are meant to attract divine vibrations from the astral world to bless the devotee and to harmonize the water or rice filled in the kalash.  The rice that is added in the pot is known as akshata, which means, \"that which is unbroken\", and it has the quality of removing any negativity present in the environment.',NULL,NULL,NULL,NULL,NULL),(42,'telugu','Shodashopachara Puja','16 Upacharas sometimes including adhanga puja and ashtotra puja for the deity. Each Upachara brings about more and more \'yeruka\' (awareness) of the presence of the divine within us and thus helps us stay connected with the lord or devi throughout the procedure without letting our mind wander away. ',NULL,NULL,NULL,NULL,NULL),(43,'telugu','Thora Grandhi Puja','Thoranam (raksha) puja',NULL,NULL,NULL,NULL,NULL),(44,'telugu','Mantra Pushpam','A reminder that the divine force that we seek, pray and worship actually exists within us, and if we are able to follow Sanatana Dharma (the way of life), we can awaken this force and remain at eternal bliss with this presence.  A reminder that the divine and us are \'abhedam\' (inseparable) and we are yet to experience this.\n\nThose who experience this enlightnment need not perform pujas anymore and that is our rishis\' wish.  They want us to perform pujas, only for us to rise beyond them towards ultimate gyana and moksha',NULL,NULL,NULL,NULL,NULL),(46,'telugu','Ayushya Homam','The pradhana ayur devatha is offered havissu along with the other devatas that were invited during the kalasa sthapana and mandaparadhana.   Ayusha suktham and ayur devatha mantram are utilised while performing the homam.  Maha mrutyunjaya, saptha chiranjeevulu, dhanvantari are also considered as prominent during the procedure.',NULL,NULL,NULL,NULL,NULL),(47,'telugu','Lakshmi Kubera Homam','Maha lakshmi and kubera are offered havissu along with moola mantram. Sri sukhtam 11 times and ammavaru moola mantram and kubera moola mantram is recited 108 times.',NULL,NULL,NULL,NULL,NULL),(48,'telugu','Sudarshana Homam','During kalasha sthapana, maha lakshmi sahitha vishnu, sudarshana, garuda are invited and concecrated.   100 shloka sudarshana shatakam and sudarshana mula mantram is recited 108 times while performing the sudarshana homam',NULL,NULL,NULL,NULL,NULL),(49,'telugu','Mrutyunjaya homam','Mrutyunjaya along with ammavaru are concecrated via aavahanam.  Along with this, ekadasa rudras that govern the health of our body are invoked as well.  With maha mruthyunjaya mantram the homam is performed. Dhanvantari devi is also offered havissu as part of this procedure.',NULL,NULL,NULL,NULL,NULL),(50,'telugu','Satyanarayana Vratam','Full procedure of satyanarayana vratam once again reminding us the power of truth and need of honesty and ethics, in order to make this occasion successful',NULL,NULL,NULL,NULL,NULL),(51,'telugu','Navagraha Homam',' 1/10th of the japam count has to be offered as tarpanam to the graha. For e.g. if 6000 japam was performed, then 600 times tarpanam needs to be offered. Following the same 1/10th of tarpanam count has to be offered to the graha during homam with mantra, dhravyam . For e.g  if 6000 japam was performed, then 600 times tarpanam needs to be offered and 60 times, homam offering needs to be given .\n\nDepending on which graha balance needs to be restored, that particular grahas are offered havissu with a prominent count.   The count depends on the intensity of the problem to be solved and has a mathematical relationship with the tarpanam and japam that was offered to the graha.\n\nSurya	(6  multiples    / 108)\nChandra  (10 multiples  / 108)\nKujudu	(7 multiples   / 108)\nBudhudu	(17 multiples  / 108)\nGuruvu	(16 multiples   / 108)\nSukrudu	 (20 multiples   / 108)\nShani	(19 multiples   / 108)\nRahu	(18 multiples   / 108)\nKetu	(7 multiples   / 108)','If you have not performed any tarpana or japam and have been advised to perform navagraha homam directly, please mention the same in your call with our pujari.  He will accordingly guide and plan the puja.',NULL,NULL,NULL,NULL),(52,'telugu','Shop / Business Dwara Pooja','Along with lightning lamps usually the consort of yajamani applies turmeric and decorates the threshold. The yajamani bows to gadapa/dwara and pays his obeisance to the threshold which is manifest of mahalakshmi then followed by breaking of pumpkin balipradhana (sacrifice /offering)\nThe spilling of navadhanyas which signifies prosperity is done, finally step into the new space where prospectively business is conducted \n',NULL,NULL,NULL,NULL,NULL),(53,'telugu','Naamakarana','A plate of rice is taken. With a gold ring wrapped with darbha, 3 lines are drawn and three different names are written by the father.\n1st line: Maasa namam, 2nd line: Nakshatra namam: 3rd : Vyavaharika namam  . Once this is done, the child is placed in cradle Three names are recited in child\'s ear along with mantra by pujari. Followed by the pujari, the mother, the father and the grandparents repeat the same and bless the child.\n\nDepending ojn the family traditions, culture of the region etc. the sequence or the steps would vary.  The pujari would accordingly guide the event. \n',NULL,NULL,NULL,NULL,NULL),(54,'telugu','Bhoomi Puja','Bhoomi devi ?prudhvi devata aavahana is done into the kalasha.  Bhu devi is worshipped with bhu suktham .  Milk and water is sprinked on the water.  On the ishyanya corner the yajamani digs some mud. The yajamani\'s wife, takes this mud and dispatches it in the nairuthi corner of the land.  \n\nKalasham with some special ingredients or shanku is placed in the land at that location, covered with bricks and puja is performed. ',NULL,NULL,NULL,NULL,NULL),(55,'telugu','Ganesha Navaratri Puja','Puja on 1st day or 3 days or 5 days or 9 days as required.\nPuja on morning or evening or both as required.\n\nOur pujari will be present as you opted for and take care of the nithya puja, devotees, aashirvachanam etc.\n\n','Please mention if you need any other pujas like ganapati homam etc. We will accordingly arrange for the same',NULL,NULL,NULL,NULL),(57,'telugu','Ganapathi Pooja /గణపతి పూజ',NULL,NULL,NULL,NULL,NULL,NULL),(58,'telugu','Punyahavachana/పుణ్యావాచనం',NULL,NULL,NULL,NULL,'2023-08-12 03:14:37',NULL),(59,'telugu','Pavitra Dharana/ పవిత్ర ధారణ ',NULL,NULL,NULL,NULL,NULL,NULL),(60,'telugu','Sankalpam/సంకల్పం',NULL,NULL,NULL,NULL,NULL,NULL),(61,'telugu','Pradakshina Trayam/ప్రదక్షణ త్రయం',NULL,NULL,NULL,NULL,NULL,NULL),(62,'telugu','Kshanalu/క్షణాలు',NULL,NULL,NULL,NULL,NULL,NULL),(63,'telugu','Paada Prakshalanamu/పాద ప్రక్షాళనం',NULL,NULL,NULL,NULL,NULL,NULL),(64,'telugu','Pavitra Visarjanam/పవిత్ర విసర్జనం',NULL,NULL,NULL,NULL,NULL,NULL),(65,'telugu','Pavitra Dharana/పవిత్ర ధారణ',NULL,NULL,NULL,NULL,NULL,NULL),(66,'telugu','Swayam Pakam/స్వయం పాకం',NULL,NULL,NULL,NULL,NULL,NULL),(67,'telugu','Pinda Pradhanam/పిండ ప్రదానం',NULL,NULL,NULL,NULL,NULL,NULL),(68,'telugu','Pinda Pooja/పిండ పూజ',NULL,NULL,NULL,NULL,NULL,NULL),(69,'telugu','Dasa Dhanalu/దశ దానాలు',NULL,NULL,NULL,NULL,NULL,NULL),(70,'telugu','Shodasa Dhanalu Udvasana/షోడశ దానాలు ఉద్వాసన',NULL,NULL,NULL,NULL,NULL,NULL),(71,'tel