INSERT INTO `pujas` VALUES (4,'Naamakaranam','A puja to help name the baby most appropriately, in the presence of vedic mantras and a guru\'s blessing. This is one of the sixteen vedic samskaras in Sanatana Dharma','telugu','Hyderabad','at_my_home','remote',NULL,NULL,'[\"https://www.youtube.com/embed/SsRsg2jC-ec\",\"https://www.youtube.com/embed/CkuMjlP8w9A\",\"https://www.youtube.com/embed/qrdxFxKIYNY\",\"https://www.youtube.com/embed/tQJc70v5O2o\"]','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,NULL,NULL,NULL,'2023-07-05 10:49:42','9',NULL,2,'naamakaranam'),(6,'Aksharabhyasam','Puja to mark the beginning of education and to seek blessings of Ganesha and Saraswathi devi. ','telugu','Hyderabad','at_my_home','remote',NULL,NULL,'[\"https://www.youtube.com/embed/SsRsg2jC-ec\",\"https://www.youtube.com/embed/CkuMjlP8w9A\",\"https://www.youtube.com/embed/qrdxFxKIYNY\",\"https://www.youtube.com/embed/tQJc70v5O2o\"]','[\"/uploads/2023/07/Aksharabhyasam-2.png\"]',NULL,NULL,NULL,NULL,NULL,'2024-01-30 12:23:03','47',NULL,2,'aksharabhyasam'),(10,'Gruhapravesham','Gruhapravesha puja is designed to make a home’s space / environment conducive for the people living in it and to help them move towards their wellbeing. \nThis puja is a culmination of several branches of scriptures/ shastras, and is intended for balancing out any vaastu doshas, and imbalances in the five basic elements and the eight directions.\n','telugu','Hyderabad','at_my_home',NULL,NULL,NULL,'[\"https://www.youtube.com/embed/4ijX9N6xEBo\",\"https://www.youtube.com/embed/w_JnwafQQNw\"]','[\"/uploads/2023/07/Gruhapravesham-2.jpeg\",\"/uploads/2023/07/Gruhapravesham-1-scaled.jpg\"]',NULL,NULL,NULL,NULL,NULL,'2024-03-13 05:34:13','47',NULL,5,'gruhapravesham'),(16,'Ganapati Homam','A certain amsha / energy of Ganapati is worshipped through this homam.  Ganapati combines the energy of Shiva and Parvati. Through the peacefulness of Shiva and the creative power of Parvati, and with his enormous intelligence removes all the obstacles from our path.','telugu','Hyderabad','at_my_home','on_behalf','remote',NULL,'[\"https://www.youtube.com/embed/SsRsg2jC-ec\",\"https://www.youtube.com/embed/CkuMjlP8w9A\",\"https://www.youtube.com/embed/qrdxFxKIYNY\",\"https://www.youtube.com/embed/tQJc70v5O2o\"]','[\"/uploads/2023/07/Homam-2-scaled.jpg\"]',NULL,NULL,NULL,NULL,NULL,'2023-08-09 04:55:33','44',NULL,4,'ganapati-homam'),(24,'Satyanarayana Vratam','Sri Satyanarayana Pooja Vrat is performed with the sankalpam (resolve) to Lord Vishnu in the form of Sri Satya Narayana Swamy, seeking his benevolence to remove all the Obstacles and negative Forces and lead to victory or success in all the endeavours. Sri Satyanarayana Vrata is performed with puja offerings and satyanarayana katha is recited. This vrata is also observed after important events like gruhapravesha, the beginning of new ventures, marriage, or after the successful completion of major events.','telugu','Hyderabad','at_my_home',NULL,NULL,NULL,'[\"https://www.youtube.com/embed/w_JnwafQQNw\",\"https://www.youtube.com/embed/uZjCFWCu7eM\",\"https://www.youtube.com/embed/4z4DcaIPVAA\"]','[\"/uploads/2023/07/satyanarayan_vratam.jpg\"]',NULL,NULL,NULL,NULL,NULL,'2023-08-18 06:21:21','44',NULL,2,'satyanarayana-vratam'),(132,'Rudrabhishekam (Eka rudram)','Rudras are the energies that have originated from Lord Shiva and control several aspects within our body.  There are a total of eleven prominent Rudras that govern the pranas and upapranas which are worshipped in Rudrabhishekam\n\nThe puja procedure given below is for Eka rudram (one recitation of namakam and chamakam) with regular offerings to the Shiva lingam such as panchamrutham.  \n\nDepending on the purpose and wish, the repetitions can vary.  Our pujari will accordingly make changes based on your requirement, after we receive your booking submission','telugu',NULL,'at_my_home','on_behalf',NULL,NULL,'[\"https://www.youtube.com/embed/DJpFNFqfngU\",\"https://www.youtube.com/embed/egsORT-tkqk\",\"https://www.youtube.com/embed/ku6Op_DJgDo\",\"https://www.youtube.com/embed/pArLQEQyECA\",\"https://www.youtube.com/embed/Yf5vE75JAUg\"]','[\"/uploads/2023/07/Rudrabhishekam-Right-Size.png\"]',NULL,NULL,'2023-06-02 10:45:35',NULL,NULL,'2023-07-24 07:04:37','44',NULL,2,'rudrabhishekam'),(135,'Navagraha Homam','The term Navagraha denotes the nine celestial bodies that form the base for astrological calculations. Nava means \'Nine\' and Graha means \'energy\', \'force\' or \'controller\' so Navagraha Pooja is a prayer (ritual) performed to energies according to the nine forces.\n\nThese nine devatas govern important aspects in our life that make us experience joy or sadness based on our karma.  The real goal of any navagraha puja or astrology related pujas is to come out of problems that are really bothering us and to ultimately start our journey towards eeshwara so that we won\'t need such pujas in the future\n\nIf you are advised to perform this homam or any other astrological related shanti, japa etc. and if you are not sure whether you need to, do speak to us.  Our pujaris will analyse and advice you if you really need this puja OR if you can solve your issue in other ways, which only require your investment of time and shraddha.','telugu',NULL,'at_my_home','on_behalf','remote',NULL,'[\"https://www.youtube.com/embed/YT3nFDlrnuw\",\"https://www.youtube.com/embed/r6YyE-Wj9kU\"]','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-07 11:15:46',NULL,NULL,'2023-07-24 07:02:24','44',NULL,3,'navagraha-homam'),(136,'Varalakshmi Vratham','The Varalakshmi Vratham is primarily performed by married women (Sumangali), for their own well-being, and in order to ask the goddess to bless their husbands with health and longevity. \n\nHowever, there is a much more deeper meaning and purpose for these vrathas.  Vratha and truthfulness are a part of Ashtanga yoga. They act like external support systems which support our inward journey to achieve a balanced state of mind.\nEach Vratha refines a certain aspect of our personality and Varalakshmi Vratha focusses on building a naturally unconditional helpful nature.  \n','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-08 08:13:45',NULL,NULL,'2023-08-22 06:06:06','47',NULL,2,'varalakshmi-vratham'),(137,'Mangala Gowri Vratham','Mangala Gowri Vratam is dedicated to Goddess Parvathi. Mangala Gowri Pooja/ Sravana Mangala Gowri Pooja is an important Vratam observed by married women. It is performed to get happy married life and for the long life of the husband. A minimum of five women are invited and offer Thamboolam.','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-09 07:52:37',NULL,NULL,'2023-07-15 06:31:27','47',NULL,2,'mangala-gowri-vratham'),(138,'Punsavanam','The Punsavanam Sanskar is the second sanskara for the baby in mother\'s womb. Punsavanam Sanskara is performed tpwards around the end of the second month of pregnancy or in the beginning of the third month. It is performed on the first Pushya Nakshatra after the mother comes to know that she is pregnant.','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-10 08:55:08',NULL,NULL,'2023-07-05 10:24:01','9',NULL,2,'punsavanam'),(139,'Garbhaadanam','Garbhadhana is a composite word of Garbha (womb) and Ādhāna (process of receiving), and it literally means receiving pregnancy. It is a private rite of the intent of a couple to have a child. It is a ceremony performed before Nisheka (conception and impregnation)\n\n','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-10 09:07:09',NULL,NULL,'2023-09-29 16:09:23','9',NULL,3,'garbhaadanam'),(140,'Seemanthonayanam','Seemantham Ceremony Baby Shower (Valaikappu Function) is also called a baby shower in the northern states of India. The word Seemantham describes the meaning of the hair parting process just above the eyebrows where Goddess Lakshmi, goddess of wealth repose.','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\",\"/assets/images/gruha_pravesam.jpeg\"]',NULL,NULL,'2023-06-13 06:06:32',NULL,NULL,'2024-06-10 11:35:46','47',NULL,2,'seemanthonayanam'),(141,'Annaprasana','The word annaprāśana is made of two Sanskrit words, anna meaning \'cooked rice\' and prāśana meaning \'feeding\'. The ceremony of annaprashana is referred to in English as grain initiation or rice-feeding ceremony','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/Annaprashana-2.png\"]',NULL,NULL,'2023-06-13 06:23:57',NULL,NULL,'2023-07-10 06:35:08','9',NULL,2,'annaprasana'),(142,'Upanayanam','Upanayanam, lit. \'initiation\') is a Hindu educational sacrament, one of the traditional saṃskaras or rites of passage that marked the acceptance of a student by a preceptor, such as a guru or acharya, and an individual\'s initiation into a school in Hinduism','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-13 06:34:31',NULL,NULL,'2024-02-22 18:24:56','44',NULL,5,'upanayanam'),(143,'Shankusthapana  (Bhumi pooja)','Bhumi pooja is performed to seek the blessings and permission of Goddess Bhoomi or earth and Vastu Purush (the deity of directions), before beginning the construction of a new house / place of business etc. The five elements of nature are also worshipped during the bhumi puja','telugu',NULL,'at_my_home',NULL,NULL,NULL,'[\"https://www.youtube.com/embed/4ijX9N6xEBo\"]','[\"/uploads/2023/07/Bhoomi-pujas-2.jpg\",\"/uploads/2023/07/Bhoomi-Puja-scaled.jpeg\"]',NULL,NULL,'2023-06-15 08:38:11',NULL,NULL,'2023-07-20 18:59:45','44',NULL,2,'shankusthapana'),(144,'Vaahana Pooja','A pooja to gain God\'s blessings for a new vehicle. The pooja is done to satisfy the Gods on the possession of the vehicle, such that they protect us while we travel in it','telugu',NULL,'remote','at_my_home',NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\",\"/assets/images/gruha_pravesam.jpeg\"]',NULL,NULL,'2023-06-16 06:06:56',NULL,NULL,'2023-07-24 07:04:00','44',NULL,1,'vaahana-pooja'),(145,'Shashtipoorthi','Shastipoorthi pooja is a Hindu ceremony that is performed when a couple completed their 60 years of marriage successfully. Shastipoorthi pooja cost also known as Shasthi Abda Poorthi where the meaning of Shasti means = 60, adba means = years, and poorthi means = completion','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\",\"/assets/images/gruha_pravesam.jpeg\"]',NULL,NULL,'2023-06-16 06:09:30',NULL,NULL,'2023-07-05 10:32:32','9',NULL,20,'shashtipoorthi'),(146,'Saraswathi Homam','Saraswathi homam is performed for the Goddess Saraswati. She is the deity of Wisdom, Knowledge, and Intelligence. This homam is uniquely done for the students to invoke the blessing of Goddess Saraswati to improve their academic ranking and to boost their career life','telugu',NULL,'at_my_home','remote','on_behalf',NULL,'undefined','[\"/uploads/2023/07/Saraswathi-Homam-Resized.png\"]',NULL,NULL,'2023-06-16 06:14:44',NULL,NULL,'2023-07-24 07:04:52','44',NULL,3,'saraswathi-homam'),(147,'Lakshmi Kubera Homam','The Lakshmi Kubera Homam is usually performed by the devotees to get blessed with luxuries, financial growth, and success with the benevolence of Goddess Lakshmi and lord of wealth Kubera. This homam impacts us to improve and overcome financial hindrances which block the flow of wealth.','telugu',NULL,'at_my_home','remote','on_behalf',NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-16 06:17:03',NULL,NULL,'2023-07-24 07:03:01','44',NULL,6,'lakshmi-kubera-homam'),(148,'Maha Mryutyunjaya Homam ','Maha Mrityunjaya Homam is performed by devotees to prevent premature deaths. The homam is dedicated to Lord Shiva in the form of mrityunjaya who blesses the devotee with long life. The significance of this Maha Mrityunjaya Homam is that it has been passed on to us via work done by Markandeya maharshi and several others, giving an opportunity for humans to win over untimely or unripe death or any physical illness. \nThe purpose of extending one\'s life or to get blessed with health is to further one\'s spiritual pursuit while also fulfilling worldy duties.  When people with such an inner intention perform the puja, Shiva overwrites any karmic balance to grant the devotee with the extra life span.  \nChildren or shishyas also perform these pujas for their elders or guri, since they wish them to be alive in the current upadhi and continue to guide them','telugu',NULL,'at_my_home','remote','on_behalf',NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-06-16 06:24:46',NULL,NULL,'2023-07-24 07:02:45','44',NULL,3,'maha-mryutyunjaya-homam '),(149,'Ayushya Homam ','Ayushya means lifespan in Sanskrit. Ayush homam is the worship of Ayur Devatha (God of life). By performing this ayush homam, one is blessed with good health and long life. As mentioned in Bodhayana sutras, if a child is falling ill often, this homam could be performed regularly until the child gets better','telugu',NULL,'at_my_home','on_behalf','remote',NULL,'undefined','[\"/uploads/2023/11/IMG_20230822_150644.jpg\"]',NULL,NULL,'2023-06-16 06:26:13',NULL,NULL,'2023-11-16 05:25:19','44',NULL,6,'ayushya-homam '),(150,'Sudarshana Homam','The fire ritual ceremony of Sudarshana Homam is performed to seek the benevolence of Lord Vishnu through his possession of Sudarshana, in the form of deity with 16 hands. “Su” means the right. “Darshana: means vision. When Lord Sudarshan is invoked with prayers, it sets out to fulfil the Ishtakaamya of the devotee. This Homam holds the power to remove malefic effects of evil spirits, troubles caused by enemies and witchcraft. It needs to be performed with shraddha and under the guidance of an able pujari who has strong vishnu upasana.  This puja is at times,  performed for protection from evil eyes, dark malefic forces, and for success in business, work and life.','telugu',NULL,'at_my_home','on_behalf','remote',NULL,'undefined','[\"/uploads/2023/11/IMG_20230822_150614-scaled.jpg\"]',NULL,NULL,'2023-06-16 06:28:06',NULL,NULL,'2023-11-16 05:23:52','44',NULL,4,'sudarshana-homam'),(154,'Shop/ Office/ Company Opening','Puja performed before officially launching or opening a new business / shop / corporate. ','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/default-no-puja-image.jpg\"]',NULL,NULL,'2023-07-08 11:14:38','47',NULL,'2023-08-22 10:37:21','47',NULL,2,'shop-office-company-opening'),(155,'Punyahavachanam','Punyaham means auspicious, and vachanam means to recite. In this puja, specific mantras are recited which purify us and our surroundings and bring forth the auspiciousness required before performing a vedic action or any auspicious events. The mantra shakti is embedded into the kalasha jalam and leads to prosperity of the doer and their family tree','telugu',NULL,'at_my_home',NULL,NULL,NULL,'undefined','[\"/uploads/2023/07/DSC01273-2.jpg\"]',NULL,NULL,'2023-07-08 12:06:56','47',NULL,'2023-07-16 07:56:27','47',NULL,2,'punyahavachanam'),(156,'Samvathsarikam (యజుర్వేదులు/Yajurvedulu)','This puja procedure is performed exactly 1 year after the person departs (as per tidhi) and the entire procedure lasts for 3 days in total. \n\nThe Pujari & Venue cost 56500Rs is to be paid additionally and includes all of the following:\n\n1) Entire procedure as per shastras is followed for all the three days including charges for brahmins and bhoktas \n2) Venue rent for all the three days. The entire floor in an independent house and peaceful location in Hyderabad is booked for the event\n2) All dasa danaalu including praytaksha Govu-Daanam\n3) Food for 3 bhoktas all three days and for 2 family members (total 5 members per day)\n4) Extra per person - Charges 350Rs per head  (on day 1 & 3)\n5) Extra per person - Charges 450Rs per head (on day2) - cooking is performed in two sets, one for family and one for guests\n\n(Please mention in special notes, how many people are expected for bhojana on day1 and day2 and day3  separately & any other special requirements in menu etc.)','telugu',NULL,'at_my_home',NULL,NULL,NULL,'[\"https://www.youtube.com/embed/6Ds6AjK7Tag?si=UH2ouS4Hv61jxDQC\",\"https://www.youtube.com/embed/KFwwShVNpn8?si=Qm9jZsz9BBaFzyO3\",\"https://www.youtube.com/embed/ub84z5rBcJk?si=rza3W5bPc_h0TKRb\"]','[\"/uploads/2023/07/Samvatsrikam-2.png\",\"uploads/2023/11/IMG_20230916_135505-scaled.jpg\"]',NULL,NULL,'2023-07-10 05:43:50','47',NULL,'2023-11-16 05:14:10','44',NULL,10,'samvathsarikam-yajurvedulu'),(157,'Aabhdhikam (యజుర్వేదులు/Yajurvedulu)','Every year on the \'tidhi\' when our ancestor has passed away, this puja is to be performed.  This is a very very important ritual and it helps us repay back the \'pitru runam\' and in turn ensures good health and prosperity for our next generations. \n','telugu',NULL,'at_my_home','on_behalf',NULL,NULL,'[\"https://www.youtube.com/embed/6Ds6AjK7Tag?si=UH2ouS4Hv61jxDQC\",\"https://www.youtube.com/embed/KFwwShVNpn8?si=Qm9jZsz9BBaFzyO3\",\"https://www.youtube.com/embed/ub84z5rBcJk?si=rza3W5bPc_h0TKRb\"]','[\"/uploads/2023/07/Abdhikam-2.png\"]',NULL,NULL,'2023-07-10 06:10:33','47',NULL,'2023-11-16 05:15:16','44',NULL,3,'aabhdhikam-yajurvedulu'),(158,'Masikam (యజుర్వేదులు/Yajurvedulu)','Once the departed soul joins the pitru lokas, the earthly family members perform monthly rites called \'Masika\'','telugu',NULL,'at_my_home','on_behalf',NULL,NULL,'undefined','[\"/uploads/2023/07/Masikam-2.png\"]',NULL,NULL,'2023-07-10 06:10:57','47',NULL,'2023-07-27 16:08:04','44',NULL,2,'masikam-yajurvedulu'),(167,'Ganesha - For Navaratri Pandals (Corporate Offices / Community / Colony) - EcoFriendly Mud/Clay ','Step 1: Select the Ganesha Idol of your choice by checking the photos . Remember the IDOL NUMBER\n\nStep 2:  Go to Add Ons in Samagri, and select the Ganesha size that you wish for\n\nStep 3: Customize other samagri items as per the quantities you require\n\nStep 4:  Click on Proceed.  In Special Notes, mention IDOL NUMBER. \n\nIf you are also looking for Pujari for your pandal, specify if you require pujari for 1 day/ 3 days/ 5 days / 9 days  \n\nPujari charges are 1000rs per visit\n\n1 Day Only morning / Only evening - 1000 Rs\n1 Day Morning and Evening - 2000Rs\n\n3 days Only morning / Only evening - 3000Rs\n3 days Morning and Evening - 6000Rs\n\n5 days Only morning / Only evening - 5000Rs\n5 days Morning and Evening - 10000Rs\n\n9 days Only morning / Only evening - 9000Rs\n9 days Morning and Evening - 18000Rs\n\nPlace the booking with your details and our representative will contact you and finalize the booking\n','telugu',NULL,'at_my_home',NULL,NULL,NULL,'[\"https://www.youtube.com/embed/ET38mTYA3rg\",\"https://www.youtube.com/embed/mNX2gbk7hlw\",\"https://www.youtube.com/embed/arrvt-fQZ2s\"]','[\"/uploads/2023/07/Ganesha-20-inch.png\",\"/uploads/2023/07/Ganesh-2023-Big-Rate-Card.png\",\"/uploads/2023/07/Ganesha-2ft-1.png\",\"/uploads/2023/07/Ganesha-2ft-2.png\",\"/uploads/2023/07/Ganesha-2ft-3.png\",\"/uploads/2023/07/Ganesha-2.5ft.png\",\"/uploads/2023/07/Ganesha-3ft.png\",\"/uploads/2023/07/Ganesha-4-ft.png\",\"/uploads/2023/07/Ganesha-5ft.png\",\"/uploads/2023/07/Ganesha-5.8ft.png\"]',NULL,NULL,'2023-07-21 11:29:32','47',NULL,'2023-07-25 18:17:27','44',NULL,4,'ganesha-for-navaratri-pandals'),(168,'Ganesha Chaturdhi Kit - River Ganesha 10 inch & 21 Patri (Vinayaka Vratam Kit)','10 inch River Clay Ganesha  (One of the above three models will be sent)\n\n21 Ayurvedic Patri  and Other Samagri (Select from Addons.  All proceedings will be towards NGO helping in tribal girl education)','telugu',NULL,'at_my_home',NULL,NULL,NULL,'[\"https://www.youtube.com/embed/ET38mTYA3rg\",\"https://www.youtube.com/embed/mNX2gbk7hlw\",\"https://www.youtube.com/embed/arrvt-fQZ2s\"]','[\"/uploads/2023/08/Ganesha-Home-2023-Models-All-3-with-left-indicated.png\"]',NULL,NULL,'2023-07-25 17:45:35','44',NULL,'2023-08-08 07:35:52','44',NULL,2,'ganesha-chaturdhi-kit-river-ganesha-10-inch'),(169,'Aabhdhikam/ అభ్ధికం  ( ముగ్గురు భోక్తలు/ Three Bhotha)','Every year on the \'tidhi\' when our ancestor has passed away, this puja is to be performed.  This is a very very important ritual and it helps us repay back the \'pitru runam\' and in turn ensures good health and prosperity for our next generations. \n','telugu',NULL,'at_my_home','on_behalf',NULL,NULL,'[\"https://www.youtube.com/embed/6Ds6AjK7Tag?si=UH2ouS4Hv61jxDQC\",\"https://www.youtube.com/embed/KFwwShVNpn8?si=Qm9jZsz9BBaFzyO3\",\"https://www.youtube.com/embed/ub84z5rBcJk?si=rza3W5bPc_h0TKRb\"]','[\"/uploads/2023/07/Abdhikam-2.png\"]',NULL,NULL,'2023-07-27 13:08:44','47',NULL,'2023-11-16 05:15:38','44',NULL,2,'aabhdhikam-three-bhotha'),(171,'Samvathsarikam/సంవత్సరీకం','This puja procedure is performed exactly 1 year after the person departs and only performed during the 1st year.  From 2nd year onwards Aabdhikam is performed.','telugu',NULL,'at_my_home',NULL,NULL,NULL,'[\"https://www.youtube.com/embed/6Ds6AjK7Tag?si=UH2ouS4Hv61jxDQC\",\"https://www.youtube.com/embed/KFwwShVNpn8?si=Qm9jZsz9BBaFzyO3\",\"https://www.youtube.com/embed/ub84z5rBcJk?si=rza3W5bPc_h0TKRb\"]','[\"/uploads/2023/07/Samvatsrikam-2.png\",\"uploads/2023/11/IMG_20230916_135505-scaled.jpg\"]',NULL,NULL,'2023-07-27 13:11:07','47',NULL,'2024-11-25 07:43:08','44',NULL,3,'samvathsarikam'),(172,'Chandi Homam/చండి హోమం ','Chandi is a primordial energy which is responsible for the creation, maintenance and destruction of our universe. She is the sum total of the energies of all beings of this universe.\n\nChandi Homam performed to goddess is an effective tool in Kali yuga. It helps